import React, {Component} from 'react';
import {Link} from 'react-router-dom';

class Header extends Component {
    render(){
        return(
            <div>
				<div className="slider-area brown__nav slider--15 slide__activation slide__arrow01 owl-stage-outer owl-stage owl-loaded owl-drag owl-carousel owl-theme">
					<div className="slide animation__style10 bg-image--1 fullscreen align__center--left">
						<div className="container">
							<div className="row">
								<div className="col-lg-12">
									<div className="slider__content">
										<div className="contentbox">
											<h2>Buy <span>your </span></h2>
											<h2>favourite <span>Book </span></h2>
											<h2>from <span>Here </span></h2>
											<Link className="shopbtn" to="/">shop now</Link>
										</div>
									</div>
								</div>
							</div>
						</div>
					</div>					
				</div>
			</div>
        );
    }
}

export default Header;
